export default function Agenda({ contactos, title }) {
  return (
    <div className="list-group w-30">
      <h3>Lista de contactos</h3>
      {contactos.map(
        ({ id, nombre, apellido, direccion, ciudad, cod, telefono }, index) => (
          <ul key={id}>
            <li class="list-group-item list-group-item-action active">
              Contacto {index}
            </li>
            <li class="list-group-item list-group-item-action">{nombre}</li>
            <li class="list-group-item list-group-item-action">{apellido}</li>
            <li class="list-group-item list-group-item-action">{telefono}</li>
            <li class="list-group-item list-group-item-action">
              {direccion}, {cod}, {ciudad}
            </li>
            <li class="list-group-item list-group-item-action">
              <button className="btn btn-warning">Eliminar</button>
            </li>
          </ul>
        )
      )}
    </div>
  );
}
